import React from 'react'

export const TrackSearchResult = ({ track }) => {
  return (
    <div className="d-flex m-2 align-items-ceneter">
      <img src={track.albumUrl} style={{height: "64px", width: "64px"}} />
    </div>
  )
}

export default TrackSearchResult;
